import styled from "styled-components";
import Burger from "./Burger";
// import Logo from "../Logo";

const NavBar = () => {
  return (

    <NavBarContainer>
      <NavLink>
        {/* <Logo /> */}
        <h1>Click</h1>
      <NavItems>
        <NavLink to>News</NavLink>
        {/* <NavLink>Wallet</NavLink> */}
        <NavLink>CarbChain</NavLink>
        <NavLink>Cryptocurrencies</NavLink>
      </NavItems>
      </NavLink>
      <Burger />
      {/* <div></div> */}
      <div>
          <NavLink>Login</NavLink>
      </div>
    </NavBarContainer>

  );
};

const NavBarContainer = styled.div`
  /* margin-top: -80px; // might wanna adjsut his for future projects */
  background-color: #000;
  /* background: transparent; */
  color: red;
  /* width: 100%; DO NOT INCLUDE THIS IF YOU ARE USING CALC!!!!! */
  height: 64px;
  display: flex;
  justify-content: space-between;
  padding: 0.5rem calc((100vw - 1000px) / 2); /* THIS IS THE MAGIC!!!!!!!!!!!! */
  z-index: 10;
`;

const NavLink = styled.a`
  color: red;
  display: flex;
  align-items: center;
  text-decoration: none;
  padding: 0 2rem;
  height: 100%;
  cursor: pointer;

  &.active {
    color: #15cdfc;
  }
`;

const NavItems = styled.div`
  display: flex;
  align-items: center;

  @media screen and (max-width: 768px) {
    display: none;
  }
`;
export default NavBar;
